import React, { useState } from "react";
import Blogcss from "./BlogPreview.module.css";
import Slide from "../../Composants/Slide";
const BlogPreview = () => {
  return (
    <div className={Blogcss.container}>
      <div className={Blogcss.wrapper}>
        <Slide></Slide>
        <div className={Blogcss.title}>


        </div>

        <Slide></Slide>
      </div>
    </div>
  );
};

export default BlogPreview;
